import React from 'react';

const Filter = () => {
    return (
        <div>
            <h>Filter</h>
            <p>Launch Year</p>
            <div className="row">
            <div>
                <button>2006</button>
                <button>2008</button>
                <button>2010</button>
                <button>2012</button>
                <button>2014</button>
                <button>2016</button>
                <button>2018</button>
                <button>2020</button>
            </div>
            <div></div>
            </div>

        </div>

    );

}

export default Filter;
